import React, { Component } from 'react';


import Shivam from './components/Shivam';
import Satyam from './Satyam';
import Route from 'react-router-dom';
function App(){

  return(
    <div>
    <Route path="/" component={Shivam}/>

    <Route path="/home" component={Satyam}/>
   </div>
  );
}

export default App;
